import React, { Component } from 'react'
import Search from "./components/Search"
import Card from "./components/Card"

import "./App.css"

class App extends Component {
  render() {
    return (
      <div>
        <Search getProfile={this.getProfile}/>
        <Card />
      </div>
    )
  }
}

export default App
